('collection index description', 'global', '<br>This module allows user to create and manage all collections built into your laboratory.\r\n\r\n<br><br>\r\n<h4>Collection</h4>\r\nUsed to group\r\n<ul>\r\n<li> one or more specimens (or primary samples)\r\n<ul>\r\n<li>from the same participant.\r\n<li>from the same event (date & time).\r\n<li>for a specific reason (surgery, follow-up, etc).\r\n<li>related to a diagnosis (optional) or a period of time.\r\n</ul>\r\n<li>plus all the derivatives created from these specimens.\r\n</ul>\r\n\r\n<br>\r\n<h4>Sample</h4>\r\nA sample defines a biological material that is\r\n<ul>\r\n<li>Either directly taken from a participant at a specific date and\r\nwhich we will call ''primary sample'' or ''specimen'' (ex: Tissue, Blood,\r\nUrine, etc).\r\n<li>Or created from another sample at a specific date according to a\r\nspecific protocol and which we will call ''derivative sample'' (ex: DNA\r\nextraction, cell culture, etc).\r\n</ul>\r\n\r\nA sample definition can be applied to a set of biological material\r\nentities (blood tubes, etc) when all of these entities:\r\n<ul>\r\n<li>Match the previous definition (all of them have to be taken from the\r\nsame participant at a specific date or created in batch from the same\r\nsample according to the same protocol and at a specific date).\r\n<li>Present exactly the same properties (material type [DNA, blood,\r\netc], concentration, consistence, etc).\r\n<li>Are representative of the whole.\r\n</ul>\r\n\r\n<br>\r\n<h4>Aliquot</h4>\r\nAn aliquot is a measured portion of a sample:\r\n<ul>\r\n<li>Physically identifiable.\r\n<li>Taken for analysis, storage, shipping, creation of derivative sample, etc.\r\n</ul>\r\nOne or more aliquots make up a sample.', 'Ce Module permet &agrave; l&apos;utilisateur de cr&eacute;er et g&eacute;rer toutes les collections de son laboratoire.'),
