('short title', 'global', 'Short Title', ''),
('sidebar_tools_intro', 'global', '<p><b>Order Management</b><br />\r\nThis module handles shipping and order entry related tasks within a tumour bank. Orders can be populated with shippable materials from the Inventory Module or a batch set. </p>\r\n\r\n<p><b>Forms Manager</b><br />\r\nThis module allows the bank to keep track of the various forms that are be used for day-to-day operation. Examples include Consent Forms, SOP''s and Materials Transfer Agreements. </p>\r\n\r\n<p><b>Study Module </b><br />\r\nThe Study Module will store information related to each study proposed or undertaken by researchers registered with the tumour bank. </p>\r\n\r\n<p><b>Protocol Module </b><br />\r\nEach protocol lists the series of steps that need to be performed for each participant assigned to that protocol. For example, clinical status will be checked annually for participants assigned to a protocol that requires yearly follow-up. For a shipping protocol, the series of steps can be thought of as a checklist that needs to be followed for shipping materials under that protocol. Other protocols can just list common features that participants in the protocol have.</p>\r\n\r\n<p><b>Provider</b><br />\r\nThe Provider Module will store information related to each medical service provider with whom participants are interacting.</p>\r\n\r\n<p><b>Pricing</b><br />\r\nThis module will handle base pricing for a standardized list of products that a bank may ship. Special discount rates for various institutions may be applied in one central location.</p>\r\n\r\n<p><b>Collection Kit</b><br />\r\nCollection Kit allows the batch creation of any materials related to the actual collection of materials from a participant. This may include:</p>\r\n<ul>\r\n<li>Printed consent forms</li>\r\n<li>Bank information sheets for the participant</li>\r\n<li>Questionnaire''s</li>\r\n<li>Pre-printed barcode labels for storage vessels</li>\r\n</ul>\r\n\r\n\r\n\r\n', ''),
